import { useNavigate } from 'react-router-dom';

function Footer() {
  const navigate = useNavigate();

  const handleGoBack = () => {
    // Use navigate(-1) to go back to the previous page
    navigate(-1);
  };

  return (
    <div>
      <button onClick={handleGoBack}>Go Back</button>
    </div>
  );
}

export default Footer;
